import React, { useEffect } from "react";
import Tmdb from "./Tmdb";

export default () => {
  const [movieList, setMovieList] = useState([]);

  useEffect(() => {
    const loadAll = async () => {
      let list = await Tmdb.getHomeList();
    };
    loadAll();
  }, []);
  return <div className="page"></div>;
};
